import React from 'react';
import './Card1.css'; // Import your CSS file for styling

// Import sample images
import cultivator from './cultivator.png'
import harrow from './harrow.jpg'
import grasscutter from './grass cutter.jpg'
import threasher from './threasher.jpg'
import rotavator from './Rotavator.jpg'
import seeddrill from './seed drill.jpg'
import sprayer from "./sprayer.jpg";
import plough from "./Plough.jpg";
import handsprayer from "./hand sprayer.jpg"
// Add more images as needed

const Card1 = () => {
    // Sample data for cards (image, title, and description)
    const cardsData = [
        { image: harrow, title: "HARROW", description: "Description for Harrow" },
        { image: rotavator, title: "ROTAVATOR", description: "Description for rotavator" },
        { image: cultivator, title: "CULTIVATOR", description: "Description for Cultivator" },
        { image: threasher, title: "THREASHER", description: "Description for Threasher" },
        { image: grasscutter, title: "GRASS-CUTTER", description: "Description for Grass Cutter" },
        { image: seeddrill, title: "SEED-DRILL", description: "Description for SEED Drill" },
        { image: sprayer, title: "SPRAYER", description: "Description for sprayer" },
        { image: plough, title: "PLOUGH", description: "Description for plough" },
        { image: handsprayer, title: "HAND-SPRAYER", description: "Description for hand sprayer" },

        // Add more card data as needed
    ];

    return (
        <>
            <div className="cards__container">
                <h3>Our Products</h3>
                <div className="cards__wrapper">
                    {cardsData.map((card, index) => (
                        <div className="cards__item" key={index}>
                            <img src={card.image} alt={card.title} className="card__image" />
                            <h3 className="card__title">{card.title}</h3>
                            <p className="card__description">{card.description}</p>
                        </div>
                    ))}
                </div>
            </div>
        </>
    );
}

export default Card1;
